import React from "react";
import ReactDOM from "react-dom";

const Header = (props) => {
  return <div>{props.course}</div>;
};

const Content = (props) => {
  return (
    <>
      <> {props.part1}</>
      <> {props.part2}</>
      <> {props.part3}</>
    </>
  );
};
const Total = (props) => {
  return (
    <>
      ({props.e1}+{props.e2}+{props.e3})
    </>
  );
};
const App = () => {
  const course = "Half Stack application development";
  const part1 = "Fundamentals of React";
  const exercises1 = 10;
  const part2 = "Using props to pass data";
  const exercises2 = 7;
  const part3 = "State of a component";
  const exercises3 = 14;

  return (
    <div>
      <Header course={course} />
      <p>
        <Content part1={part1} /> {exercises1}{" "}
      </p>{" "}
      <p>
        <Content part2={part2} /> {exercises2}{" "}
      </p>
      <p>
        <Content part3={part3} /> {exercises3}{" "}
      </p>{" "}
      <p>
        Total number of excercises{" "}
        <Total e1={exercises1} e2={exercises3} e3={exercises2}></Total>
      </p>
    </div>
  );
};

ReactDOM.render(<App />, document.getElementById("root"));
